Dispoe sobre os Colegiados Setoriais de Cultura, das Camaras Transversais e da outras providencias.
O SECRETARIO DE ESTADO DA CULTURA DO DISTRITO FEDERAL, no uso de suas 
atribuicoes previstas no artigo 11, inciso XIV, do Decreto no 27.591, de 1o de janeiro de 2007, 
RESOLVE:
Art. 1o Ficam instituidos, no ambito da Secretaria de Estado da Cultura, os Colegiados Setoriais 
e as Camaras Transversais, orgaos de assessoramento imediato do Secretario de Estado da Cul-
tura, tendo por finalidade analisar, debater e propor politicas publicas e diretrizes especificas 
para a politica cultural.
Paragrafo unico. Os Colegiados Setoriais e as Camaras Transversais promoverao a capilaridade, a 
transparencia, a participacao e a publicizacao de seus debates relacionados aos temas abordados.
Art. 2o - Ficam instituidos os seguintes Colegiados Setoriais:
I - Colegiado Setorial de Danca;
II - Colegiado Setorial de Design;
III - Colegiado Setorial de Teatro;
IV - Colegiado Setorial de Culturas Populares e Tradicionais;
V - Colegiado Setorial de Circo;
VI - Colegiado Setorial de Cultura Afro-brasileira;
VII - Colegiado Setorial de Arte e Tecnologia;

VIII - Colegiado Setorial de Arte Urbana;
IX - Colegiado Setorial de Artes Visuais;
X - Colegiado Setorial de Livro, Leitura e Bibliotecas;
XI - Colegiado Setorial de Musica;
XII - Colegiado Setorial de Audiovisual;
XIII - Colegiado Setorial de Artesanato;
XIV - Colegiado Setorial de Patrimonio;
XV - Colegiado Setorial de Moda;
XVI - Colegiado Setorial de Fotografia.
 1o A enumeracao contida no caput deste artigo nao esgota as possibilidades de constituicao de 
colegiados setoriais, que poderao ser criados, conforme as diversas expressoes da vida cultural 
que devam ser contempladas por politicas publicas.   
 2o - Por proposta dos Colegiados Setoriais ou por iniciativa do Secretario de Estado de Cultura, 
ouvidos esses Colegiados, poderao esses orgaos passar por ato de fusao de seus quadros, sendo 
redefinidas as novas composicoes.
 3o Apos o ato de fusao dos Colegiados Setoriais, os atos subsequentes obedecerao a tramitacao 
e prazos previstos para criacao de Colegiados Setoriais novos.
Art. 3o - Compete aos Colegiados Setoriais: 
I  debater, analisar, acompanhar, solicitar informacoes e fornecer subsidios a Secretaria de Estado 
da Cultura, para a definicao de politicas, diretrizes e estrategias dos respectivos setores culturais;
II  apresentar as diretrizes dos setores representados para a Secretaria de Estado da Cultura;
III  promover o dialogo entre Poder Publico, sociedade civil e agentes culturais, com vistas 
a ampliar o acesso a bens e servicos culturais e a fortalecer a economia da cultura, as cadeias 
produtivas e a circulacao de ideias, de produtos e de servicos, assegurada a plena manifestacao 
da diversidade das expressoes culturais;
IV  propor e acompanhar estudos que permitam a identificacao e diagnosticos das cadeias 
produtivas e criativas nos respectivos setores culturais;
V  promover pactos setoriais que dinamizem as cadeias produtivas e criativas, e os arranjos 
produtivos regionais;
VI  incentivar a criacao de redes sociais que subsidiem a formulacao, a implantacao e a conti-
nuidade de politicas publicas nos respectivos setores;
VII  estimular a integracao de iniciativas socioculturais de agentes publicos e privados de modo 
a otimizar a aplicacao de recursos para o desenvolvimento das politicas culturais; 
VIII  estimular a cooperacao entre os entes publicos para a formulacao, realizacao, acompa-
nhamento e avaliacao de politicas publicas na area da cultura, em especial as atinentes ao setor;
IX  subsidiar a Secretaria de Estado da Cultura na elaboracao e avaliacao das diretrizes e na 
construcao e acompanhamento do Plano Decenal de Cultura e Planos Setoriais de Cultura do 
Distrito Federal; 
X  propor parametros para a elaboracao de editais publicos e de politicas de fomento ao setor 
afim e para a avaliacao da execucao dos diversos mecanismos de incentivo cultural;
XI  promover a valorizacao e a formalizacao das atividades e modalidades de exercicio profis-
sional vinculadas a cultura, alem da formacao de profissionais da area;
XII  incentivar a promocao de atividades de pesquisa;
XIII  incentivar a fruicao da cultura; 
XIV  formular e encaminhar a Secretaria de Estado da Cultura o calendario anual das 
atividades do Setor; e
XV  debater e emitir parecer sobre consulta que lhe for encaminhada pela Secretaria de 
Estado da Cultura.
Art. 4o - A diretoria colegiada dos colegiados setoriais sera composta por 5 (cinco) representantes 
das camaras transversais eleitas pelos colegiados setoriais e estes elegerao o COORDENADOR 
DO COLEGIADO E SECRETARIO EXECUTIVO. 
Art. 5o - Os Colegiados Setoriais serao compostos por no minimo vinte (20) membros inscri-
tos que, de alguma maneira, comprovem sua atuacao no setor, desde que entre eles, haja no 
minimo cinco  regioes administrativas representadas, conforme os segmentos e a forma de 
escolha indicados a seguir:
I  dois representantes do Poder Publico, escolhidos dentre tecnicos e especialistas indicados 
pela Secretaria de Estado da Cultura; e
II  cinco  representantes da sociedade civil organizada sendo eles um representante para cada 
uma das  cinco camaras transversais; 
 1o Nos atos de que trata este artigo a dar-se-a a designacao de cada representante 
acompanhada da de um suplente.
 2o O mandato dos representantes da sociedade civil sera de dois anos, a contar da data da posse, 
sendo permitida uma unica reconducao para o mesmo Colegiado, por meio de eleicao convocada 
para este fim pelo Secretario de Estado de Cultura, sendo considerado mandato inicial a eleicao 
e posse em novo Colegiado de membro que haja imediatamente exercido mandato em outro 
Colegiado. Art. 6o - Compete ao Coordenador de seu respectivo Colegiado Setorial:
I  convocar e coordenar as reunioes do Plenario do Colegiado, cabendo lhe somente o 
voto de qualidade;
II  preparar as pautas das reunioes ordinarias e extraordinarias;
III  ordenar o uso da palavra;
IV  submeter a votacao as materias a serem decididas pelo Plenario, intervindo na ordem dos 
trabalhos ou suspendendo-os, sempre que necessario;
V  assinar atas aprovadas nas reunioes;
VI  submeter a apreciacao do Secretario de Estado da Cultura o relatorio anual do respectivo 
Colegiado Setorial; e

