79. Os certificados dos cursos de Pos-graduacao/Especializacao, Mestrado e Doutorado devem estar de 
acordo com as regras determinadas pelo Ministerio da Educacao, disponiveis em seu sitio, www.mec.gov.br.
80. Durante o procedimento de escolha de turmas, o professor que acumula licitamente 2 (dois) 
cargos, pontua, separadamente, nas duas matriculas, sendo vedada a pontuacao do tempo de 
servico prestado em uma matricula para o procedimento de escolha de turmas na outra matricula.
81. O professor de 40 (quarenta) horas semanais, que atua 20 (vinte) horas no turno diurno e 20 
(vinte) horas no noturno, tera os pontos de que trata o item 78, contados como dois professores 
com carga horaria de 20 (vinte) horas.
82. Para a contagem do tempo de servico de que trata o item 78, serao considerados os pontos relativos a 
carga horaria a que o professor estava submetido, quando do desenvolvimento de cada atividade descrita.
82.1. Considerando que a jornada de trabalho dos professores que atuam nos Centros de Educacao Pro-
fissional e no Centro de Ensino Medio Integrado do Gama (CEMI) e no regime de 20 (vinte)/20 (vinte) 
horas semanais, para o computo do tempo de servico nessas unidades escolares devera ser considerada a 
pontuacao de professor 20 (vinte) horas, em cada turno de trabalho, observando-se o turno de trabalho atual.
83. Havendo concomitancia de mais de uma atividade, no mesmo periodo, sera computada 
apenas a de maior pontuacao.
84. No computo do tempo de servico, a fracao igual ou superior a 180 (cento e oitenta) dias sera 
arredondada para 01 (um) ano.
85. Em caso de empate, quando se tratar de escolha de turmas para o Ensino Regular e Educacao 
de Jovens e Adultos, tera prioridade, pela ordem, o professor:
a) concursado para o componente curricular pleiteado;
b) com maior pontuacao obtida no subitem I do item 78;
c) com maior pontuacao obtida no subitem II do item 78;
d) com maior pontuacao obtida no subitem III do item 78;
e) com maior pontuacao obtida no subitem IV do item 78;
f) com maior idade.
86. Em caso de empate, quando se tratar de escolha de turmas para a Educacao Especial, tera 
prioridade, pela ordem, o professor:
a) com maior pontuacao obtida no subitem XXII do item 78;
b) com maior pontuacao obtida no subitem XXIII do item 78;
c) com maior pontuacao obtida no subitem XXIV do item 78;
d) com maior pontuacao obtida no subitem XXV do item 78;
e) com maior idade.
87. Em caso de empate, quando se tratar de escolha de turmas para a Educacao Profissional, tera 
prioridade, pela ordem, o professor:
a) concursado para o componente curricular pleiteado; 
b) com maior pontuacao obtida na alinea I do item 78; 
c) com maior pontuacao obtida na alinea XXIX do item 78; 
d) com maior pontuacao obtida na alinea II do item 78; 
e) com maior pontuacao obtida na alinea III do item 78; 
f) com maior pontuacao obtida na alinea IV do item 78; 
g) com maior idade.
88. O professor que possuir mais de uma licenciatura plena na area de educacao tera seu diploma
